import React from 'react';

const Orders = ({orders}) => {
  return (
      <div>
        {orders.length
            ? orders.map(order => {
                <div>{order.id} . {order.status}</div>
                {order.items.length
                    ? order.items.map(item => {
                        <div>{item.id} - {item.name}<br /></div>
                    }) : 'Order without items...'
                }
            })
            : 'Collection is empty'
        }
      </div>
  );
}

export default Orders;
